import { Card, Table, Form, Input, DatePicker, Button, Checkbox, Row, Col } from 'antd'
import React, { Component } from 'react'
import moment from 'moment'
import UserHead from '../../../components/UserHead'
import LinkButton from '../../../components/LinkButton'
import MyNavLink from '../../../components/MyNavLink';
import './TicketList.css'

export default class TicketList extends Component {

    state = {
        dataSource: []
    }

    // 跳转到预定页面
    orderTicket = () => {
        console.log('预定')
    }

    // 条件搜索
    searchTicket = () => {
        console.log("发请求")
    }

    // 设置不能选择的日期
    disabledDate = (current) => {
        return current && current < moment().subtract(1, 'days')
    }
    componentDidMount() {
        this.setState({ dataSource: this.props.location.state })
    }

    render() {
        const { dataSource } = this.state
        const columns = [
            {
                title: '车次',
                dataIndex: 'trainsNumber',
                key: '1',
                align: 'center',
            },
            {
                title: '起点站',
                dataIndex: 'startStation',
                key: '2',
                align: 'center',
            },
            {
                title: '终点站',
                dataIndex: 'endStation',
                key: '3',
                align: 'center',
            },
            {
                title: '出发时间',
                key: '4',
                dataIndex: 'startDate',
                align: 'center',
            },
            {
                title: '到达时间',
                key: '5',
                dataIndex: 'endDate',
                align: 'center',
            },
            {
                title: '历时',
                key: '6',
                dataIndex: 'consumeTime',
                align: 'center',
            },
            ,
            {
                title: '豪华型',
                key: '7',
                dataIndex: 'luxury',
                align: 'center',
            },
            ,
            {
                title: '普通',
                key: '8',
                dataIndex: 'ordinary',
                align: 'center',
            },
            ,
            {
                title: '经济',
                key: '9',
                dataIndex: 'economic',
                align: 'center',
            },
            {
                title: '操作',
                key: '7',
                render: () => (
                    <MyNavLink to="/user/orderTicket">
                        <LinkButton >预定</LinkButton>
                    </MyNavLink>
                ),
                align: 'center'
            },
        ];

        // const dataSource = [
        //     {
        //         key: '1',
        //         trainsNumber: 'G2121',
        //         startStation: '成都',
        //         endStation: '北京',
        //         startDate: '2021.01.01',
        //         endDate: '2021.0.0',
        //         consumeTime: '8',
        //         luxury: '99',
        //         ordinary: '99',
        //         economic: '99',
        //     },
        // ]

        return (
            <div>
                <UserHead />
                <div className="search-ticket">
                    <Form name="search-ticket" layout="inline" onFinish={this.searchTicket}>
                        <Form.Item
                            name="startStation"
                        >
                            <Input placeholder="出发地" />
                        </Form.Item>
                        <Form.Item
                            name="endStation"
                        >
                            <Input
                                placeholder="目的地"
                            />
                        </Form.Item>
                        <Form.Item
                            name="startDate"
                        >
                            <DatePicker
                                format="YYYY-MM-DD"
                                disabledDate={this.disabledDate}
                            />
                        </Form.Item>
                        <Form.Item style={{ width: '150px' }}>
                            <Checkbox.Group style={{ width: '100%' }} onChange={this.checkTrainType}>
                                <Row>
                                    <Col span={12}>
                                        <Checkbox value="1">高铁G</Checkbox>
                                    </Col>
                                    <Col span={12}>
                                        <Checkbox value="2">动车D</Checkbox>
                                    </Col>
                                </Row>
                            </Checkbox.Group>
                        </Form.Item>
                        <Form.Item >
                            <Button
                                shape="round"
                                style={{ width: '100px', marginLeft: '50px' }}
                                type="primary"
                                htmlType="submit"
                            >
                                查询
                            </Button>
                        </Form.Item>
                    </Form>
                </div>

                <Card
                    bordered={false}
                >
                    <Table
                        columns={columns}
                        dataSource={dataSource}
                        bordered
                        rowKey="key"
                    />
                </Card>
            </div>
        )
    }
}
